import {Injectable, SecurityContext} from '@angular/core';
import {BehaviorSubject, from, Observable} from "rxjs";
import {DomSanitizer} from "@angular/platform-browser";

@Injectable({
  providedIn: 'root'
})
export class CanvasService {

  WIDTH = 20;
  HEIGHT = 20;

  private canvas: BehaviorSubject<number[][]>;

  constructor(private readonly sanitizer: DomSanitizer){
    this.canvas = new BehaviorSubject<number[][]>(new Array(this.WIDTH).fill(new Array(this.HEIGHT).fill(0)))
  }

  public getCanvasImageObservable(): Observable<string> {
    const url = "data:image/png;base64,";
    return from(fetch(url).then(res => res.blob()).then(blob => {
      const url = URL.createObjectURL(blob);
      return this.sanitizer.sanitize(SecurityContext.URL, this.sanitizer.bypassSecurityTrustUrl(url))!;
    }));
  }
}
